-- fixed quests with wrong rewfaction values
-- quest should not remove any reputation from player
update quests set RewRepValue1=RewRepValue2, `RewRepFaction1`=`RewRepFaction2`,
`RewRepFaction2`=0,`RewRepValue2`=0 where RewRepValue1 like '%-%';
update quests set RewRepValue2=RewRepValue3, `RewRepFaction2`=`RewRepFaction3`,
`RewRepFaction3`=0,`RewRepValue3`=0 where RewRepValue2 like '%-%';
update quests set RewRepValue3=RewRepValue4, `RewRepFaction3`=`RewRepFaction4`,
`RewRepFaction4`=0,`RewRepValue4`=0 where RewRepValue3 like '%-%';
update quests set RewRepValue4=RewRepValue5, `RewRepFaction4`=`RewRepFaction5`,
`RewRepFaction5`=0,`RewRepValue5`=0 where RewRepValue4 like '%-%';

