UPDATE `creature_proto` SET `mindamage` = `minlevel` * 8.7 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 2);
UPDATE `creature_proto` SET `mindamage` = `minlevel` * 20.7 * 2 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 3);
UPDATE `creature_proto` SET `mindamage` = `minlevel` * 7.7 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 4);

# max damage
UPDATE `creature_proto` SET `maxdamage` = `mindamage` * 1.79 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 0);
UPDATE `creature_proto` SET `maxdamage` = `mindamage` * 2.79 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 1);
UPDATE `creature_proto` SET `maxdamage` = `mindamage` * 2.79 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 2);
UPDATE `creature_proto` SET `maxdamage` = `mindamage` * 2 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 3);
UPDATE `creature_proto` SET `maxdamage` = `mindamage` * 1.79 WHERE `entry` IN (SELECT `entry` FROM `creature_names` WHERE `rank` = 4);
UPDATE `creature_proto` SET `mindamage` = ROUND(`mindamage`) WHERE `mindamage`;
UPDATE `creature_proto` SET `maxdamage` = ROUND(`maxdamage`) WHERE `maxdamage`;

# armor
UPDATE `creature_proto` SET `resistance1` = `minlevel` * 109.89;
UPDATE `creature_proto` SET `resistance1` = ROUND(`resistance1`) WHERE `maxdamage`;

